    img:"https://hbomax-images.warnermediacdn.com/images/GXebONASZ8sPCwwEAAD_C/tileburnedin?size=1280x720&format=jpeg&partner=hbomaxcom&productCode=hbomax&host=artist.api.cdn.hbo.com&w=1280",
    overview:"AWohifno",
    title:"Scooby doo!"
}

function MovieList() {
    const [movies, setMovies] = useState(movieOne)

    return(
        <div className="movie-list">
            
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            <MovieItem data={movies} />
            
        </div>
    )
}

export default MovieList;
